import '../styles/Gif.css'

export default function Gif({id,title,url}) {

  return (
    <div className='container-gif'>
      <a 
      href={`#${id}`}
      className='Gif'>  
        <img alt={title} src={url} />
      </a>
    </div>
  )
}
